import React from "react";
import preLoader from "../images/preLoader.svg";
import styles from "./PreLoader.module.scss";

const PreLoader = () => {
  return (
    <img
      className={styles.preloader}
      alt="There must be a preloader!"
      src={preLoader}
    />
  );
};

export default PreLoader;
